import React , {fragment} from "react";
const Listtodo = ()=> {
    return(
        <fragment>
        <table class="table">
        <thead>
          <tr>
            <th>Description</th>
            <th>Edit</th>
            <th>Delete</th>
          </tr>
        </thead>
        <tbody>
         {/*<tr>
            <td>John</td>
            <td>Doe</td>
            <td>john@example.com</td>
          </tr>
           */} 
        </tbody>
      </table>
      </fragment>
    )
};
export default Listtodo;
